                                    <td><label htmlFor="5" className="Coupons-table-text-label">1+1</label></td>
                                    <td><label htmlFor="5" className="Coupons-table-text-label">$29.99</label></td>
                                    <td><label htmlFor="5" className="Coupons-table-text-label">FOOD</label></td>
                                    <td><label htmlFor="5" className="Coupons-table-text-label">2020-01-01</label></td>
                                    <td><label htmlFor="5" className="Coupons-table-text-label">2023-01-01</label></td>
                                </tr>
                            </tbody>
                        </table>
                    </Form>
                    <CouponsCustomerActionbar values={values} />
                </>)}
            </Formik>
